import React from "react";
import Karakter from "./Karakter";


const Karakterler= (props)=>{
    /* const data=props.data; */
    const {data}=props;
    console.log(data);
    return(

        <div>
        {data.map((item)=>{
          return(  <Karakter item={item}></Karakter>
        )
        })}

        </div>
    )
    
}

export default Karakterler;
